import './App.css';

const App = (Hello) => {
  const cardwrapperStyle = {
    backgroundColor: 'lightblue',
    padding: '10px',
    margin:'10px',
    width: '200px',
    height:'200px',
    boxShadow: '0 2px 3px #ccc',
    borderRadius: '3px',
  }
  return(
    <div style={cardwrapperStyle}>
    App
    <h1>Name - {Hello.name}</h1>
    <h1>Age - {Hello.age}</h1>
    </div>

  )
}

export default App;
